const getFeeFromFeeHandlerMulticaller = ({
  feeHandlerAddress,
  dstChainID,
  feeTokenAddress
}) => {
  const feeHandlerInstance = new Contract(feeHandlerAddress, feeHandlerabi);
  return feeHandlerInstance.getFeeSafe(dstChainID, feeTokenAddress);
};

const getFeeTokens = async ({
  feeHandlerAddress,
  provider,
  dstChainID
}) => {
  const feeHandlerInstance = new ethers.Contract(feeHandlerAddress, feeHandlerabi, provider);

  try {
    const tokens = await feeHandlerInstance.getChainFeeTokens(dstChainID);
    return tokens;
  } catch (e) {
    console.log("Fee handler error - ", e);
  }
}; //return (fees._transferFee, fees._exchangeFee, fees.accepted);


const getFeeAmount = async ({
  sourceProvider,
  sourceNetworkId,
  destNetworkId,
  network_config
}) => {
  const ethcallProvider = new Provider(sourceProvider, Number(sourceNetworkId));
  const sourceFeeHandlerAddress = network_config[sourceNetworkId].feeHandler;
  const destChainId = network_config[destNetworkId].id;
  const feeTokenList = await getFeeTokens({
    feeHandlerAddress: sourceFeeHandlerAddress,
    provider: sourceProvider,
    dstChainID: destChainId
  });
  const contractCalls = feeTokenList.map(feeTokenAddress => getFeeFromFeeHandlerMulticaller({
    feeHandlerAddress: sourceFeeHandlerAddress,
    dstChainID: destChainId,
    feeTokenAddress: feeTokenAddress
  }));
  const feeArray = await ethcallProvider.all(contractCalls);
  const newFeeTokenList = [];
  feeTokenList.forEach((feeTokenAddress, index) => {
    if (feeArray[index][2]) {
      const feeObject = {
        address: feeTokenAddress,
        transferFee: feeArray[index][0],
        exchangeFee: feeArray[index][1]
      };
      newFeeTokenList.push(feeObject);
    }
  });
  return newFeeTokenList;
};

const getTxStatus = async (txHash, networkId) => {
  const params = {
    txHash,
    networkId
  };
  const pathUrl = `${ROUTER_STATS_HOST}/api/status`;

  try {
    const res = await axios.get(pathUrl, {
      params
    });
    return res.data;
  } catch (e) {
    console.error(`Fetching Transaction Status: ${e}`);
    return undefined;
  }
};

